import React from 'react';
import { BrowserRouter, Routes, Route, Navigate, Outlet } from 'react-router-dom';

const PrivateRoute = ({ element, isAuthenticated }) => {
  return isAuthenticated ? (
    element
  ) : (
    <Navigate to="/" replace state={{ from: window.location.pathname }} />
  );
};

const Login = () => {
  // Your login component logic
  return <div>Login Page</div>;
};

const Dashboard = () => {
  // Your dashboard component logic
  return <div>Dashboard Page</div>;
};

const NotFoundPage = () => {
  // Your not found component logic
  return <div>404 Not Found</div>;
};

const App = () => {
  const isAuthenticated = /* your authentication logic here */ true;

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/" key="root" element={<Outlet />} />
        <PrivateRoute
          path="dashboard"
          element={<Dashboard />}
          isAuthenticated={isAuthenticated}
        />
        <Route path="*" element={<NotFoundPage />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
